DROP TABLE IF EXISTS `car_chassis_brake_info`;
CREATE TABLE `car_chassis_brake_info` (
  `car_id` varchar(255) NOT NULL,
  `drive_mode` varchar(255) DEFAULT NULL COMMENT '驱动方式（选填）',
  `auto_power_type` varchar(255) DEFAULT NULL COMMENT '助力类型',
  `front_suspension_type` varchar(255) DEFAULT NULL COMMENT '前悬挂类型',
  `rear_suspension_type` varchar(255) DEFAULT NULL COMMENT '后悬挂类型',
  `front_brake_type` varchar(255) DEFAULT NULL COMMENT '前制动类型',
  `rear_brake_type` varchar(255) DEFAULT NULL COMMENT '后制动类型',
  `parking_brake_type` varchar(255) DEFAULT NULL COMMENT '驻车制动类型（选填）',
  `front_wheel_size` varchar(255) DEFAULT NULL COMMENT '前轮胎规格',
  `rear_wheel_size` varchar(255) DEFAULT NULL COMMENT '后轮胎规格',
  PRIMARY KEY (`car_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

