  `fuel` varchar(255) DEFAULT NULL COMMENT '燃料类型（不为空）',
  `fuel_label` varchar(255) DEFAULT NULL COMMENT '燃油标号（不为空）',
  `oilsupply_mode` varchar(255) DEFAULT NULL COMMENT '供油方式',
  `enviroment_standard` varchar(255) DEFAULT NULL COMMENT '排放标准（不为空）',
  PRIMARY KEY (`car_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

