-- Table structure for car_info
-- ----------------------------
DROP TABLE IF EXISTS `car_info`;
CREATE TABLE `car_info` (
  `car_id` varchar(255) NOT NULL DEFAULT '' COMMENT '汽车编号',
  `brand` varchar(255) NOT NULL COMMENT '品牌',
  `car_name` varchar(255) NOT NULL,
  `conf_name` varchar(255) DEFAULT NULL COMMENT '基本配置（出场年份，排量，款式）',
  `level` varchar(255) DEFAULT NULL COMMENT '级别',
  `engine` varchar(255) DEFAULT NULL COMMENT '发动机基本信息',
  `gearbox` varchar(255) DEFAULT NULL COMMENT '变速箱基本信息',
  `body_structure` varchar(255) DEFAULT NULL COMMENT '车身结构',
  `size` varchar(255) DEFAULT NULL COMMENT '汽车尺寸',
  `maximumspeed` varchar(255) DEFAULT NULL COMMENT '最大车速',
  `cargo_volume` varchar(255) DEFAULT NULL COMMENT '行李箱容积',
  `car_age` double(4,1) NOT NULL COMMENT '车龄',
  `car_mileage` double(10,2) NOT NULL COMMENT '行驶里程',
  `car_damage` varchar(255) NOT NULL COMMENT '车辆损耗程度（越低越接近新车）',
  `iseager` varchar(255) NOT NULL COMMENT '是否急于出售',
  `price` double(10,2) NOT NULL,
  `license_address` varchar(255) NOT NULL COMMENT '牌照归属地',
  `address` varchar(255) NOT NULL COMMENT '详细验车地址',
  `islocked` varchar(255) NOT NULL DEFAULT 'n' COMMENT '是否已被人预约',
  `uid` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`car_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

